import { Topic } from '@flashcards/core'
import { GetTopicsObserverUseCase, Observable } from '../usecase'

class GetTopicsObserver implements GetTopicsObserverUseCase {
  private readonly service: GetTopicsObserverUseCase

  constructor(service: GetTopicsObserverService) {
    this.service = service
  }

  getTopicsObserver(token: string): Observable<Topic[]> {
    return this.service.getTopicsObserver(token)
  }
}

export { GetTopicsObserver }
